int edge_address(int e,int g,int matValue[TOTAL_EDGE]){
	if(g == 0)
		return 0;
	else
		return ((GF-1)+(g-1)-(matValue[e]-1))%(GF-1)+1;
}

int inv_edge_address(int e,int g,int matValue[TOTAL_EDGE]){
	if(g == 0)
		return 0;
	else
		return ((g-1)+(matValue[e]-1))%(GF-1)+1;

}





void construct_from_file(int interleaver[TOTAL_EDGE], int MatValue[TOTAL_EDGE],char* FilePrefix){
	char FileName[500];
	FILE* f;
	int N,M;
	int *ColumnDegree,*RowDegree,**VatC,**CatV;
	int c=VARIABLE_WEIGHT;
	int d=CHECK_WEIGHT;
	N=VARIABLE_NUM;
	M=N*c/d;
	ColumnDegree=(int *)calloc(N,sizeof(int));
	RowDegree=(int *)calloc(M,sizeof(int));
	for (int m=0;m<M;m++) RowDegree[m]=d;
	for (int n=0;n<N;n++) ColumnDegree[n]=c;

	VatC=(int **)calloc(M,sizeof(int *));for(int m=0;m<M;m++) VatC[m]=(int *)calloc(d,sizeof(int));
	CatV=(int **)calloc(N,sizeof(int *));for(int n=0;n<N;n++) CatV[n]=(int *)calloc(c,sizeof(int));

	strcpy(FileName,FilePrefix);

	int readBytes=0;
	f=fopen(FileName,"r");
	for (int m=0;m<M;m++){for(int i=0;i<RowDegree[m];i++){readBytes=fscanf(f,"%d",&VatC[m][i]);} }fclose(f);
	if(!readBytes){
#ifdef PRINT
		printf("Error reading LUT\n");
#endif
		return;}
	int ** NtoB=(int **)calloc(N,sizeof(int *)); for (int n=0;n<N;n++) NtoB[n]=(int *)calloc(ColumnDegree[n],sizeof(int));
	int ind[N];for(int i=0;i<N;i++)ind[i]=0;
	int e=0; for (int m=0;m<M;m++) {
		for (int k=0;k<RowDegree[m];k++){
			int n=VatC[m][k];
			NtoB[n][ind[n]++]=e++;
		}
	}
	e=0;for (int n=0;n<N;n++) { for (int k=0;k<ColumnDegree[n];k++) interleaver[e++]=NtoB[n][k];}
	strcpy(FileName,FilePrefix);strcat(FileName,"_value");
	f=fopen(FileName,"r");for(int m=0;m<M;m++){for(int i=0;i<RowDegree[m];i++)readBytes=fscanf(f,"%d",&MatValue[m*CHECK_WEIGHT+i]);}fclose(f);
	if(!readBytes){printf("Error reading LUT\n"); return;}
#ifdef PRINT
	f=fopen("Matrix","w");for(int m=0;m<M;m++){for(int i=0;i<RowDegree[m];i++) fprintf(f,"%d ",MatValue[m*CHECK_WEIGHT+i]);fprintf(f,"\n");}fclose(f);
#endif
}

void InitEncoding(int interleaver[TOTAL_EDGE],
				  int MatValue[TOTAL_EDGE],
				  int M,
				  int N,
				  int ADDGF[GF*GF],
				  int MULGF[GF*GF],
				  int DIVGF[GF*GF],
				  int G[(VARIABLE_NUM-CHECK_NUM)*VARIABLE_NUM]){

	static int H[CHECK_NUM][VARIABLE_NUM];
	int K = VARIABLE_NUM-CHECK_NUM;
	static int Perm[VARIABLE_NUM];

	for(int n=0;n<VARIABLE_NUM;n++){
		Perm[n]=n;
	}

	for (int m=0;m<CHECK_NUM;m++)
		for (int n=0;n<VARIABLE_NUM;n++)
			H[m][n]=0;

	for (int n=0;n<VARIABLE_NUM;n++)
		for(int i=0;i<VARIABLE_WEIGHT;i++){
			int e=interleaver[n*VARIABLE_WEIGHT+i];
			int m=e/CHECK_WEIGHT;
			H[m][n]=MatValue[e];
		}

	int i,j,k,l,pivot;
	int p,q;
	for(i=0;i<CHECK_NUM;i++) {
		pivot=i;
		for(l=i;l<CHECK_NUM;l++){
			if(H[l][i]!=0){
				pivot=l;break;
			}
		}
		if(pivot!=i) {
			for(j=0;j<VARIABLE_NUM;j++) {
				int t = H[i][j];
				H[i][j] = H[pivot][j];
				H[pivot][j] = t;
			}
		}
	}

	for(k=0;k<CHECK_NUM;k++){
		p=H[k][k];
		if(p==0){
			int j1,j2;
			for(j=k;j<VARIABLE_NUM;j++){
				if(H[k][j]!=0){
					j1=k;
					j2=j;
					break;
				}
			}
			if(j==VARIABLE_NUM){
#ifdef PRINT_G
				printf("parity-check matrix is not full-rank!!\n");
#endif
				exit(0);}
			p=H[k][j];
#ifdef PRINT_G
			printf("divided by zero H[%d][%d]=%3x=%3x\n", k,j,H[k][j],p);
#endif
			int t=Perm[j1];Perm[j1]=Perm[j2];Perm[j2]=t;
			for(i=0;i<CHECK_NUM;i++) {
				int t=H[i][j1];
				H[i][j1]=H[i][j2];
				H[i][j2]=t;
			}
		}
		for(j=0;j<VARIABLE_NUM;j++) {
			H[k][j]=DIVGF[H[k][j]*GF + p];
		}


		// ===== H[i] = H[i] + H[i][k]*H[k]  make upper triable matrix ===================
		for(i=k+1;i<CHECK_NUM;i++) {
			q=H[i][k];
			for(j=0;j<VARIABLE_NUM;j++) {
				int t=MULGF[q*GF + H[k][j]];
				H[i][j]=ADDGF[H[i][j]*GF+t];
			}
		}
	}
	// ===== H[i] = H[i] + H[i][k]*H[k]  make echelon matrix ============================
	for(k=1;k<CHECK_NUM;k++) {
		for(i=0;i<=k-1;i++){
			int g=H[i][k];
			for(j=0;j<VARIABLE_NUM;j++) {
				int t=MULGF[g*GF + H[k][j]];
				H[i][j]=ADDGF[H[i][j]*GF + t];
			}
		}
	}
	// ==== make G
	for (int m=0;m<K;m++){for (int n=0;n<VARIABLE_NUM;n++){G[m*VARIABLE_NUM+n]=0;}}
	for(k=0;k<K;k++){
		G[k*VARIABLE_NUM + k+CHECK_NUM]=1;
		for(j=0;j<VARIABLE_NUM-K;j++) {
			G[k*VARIABLE_NUM+j]=H[j][CHECK_NUM+k];
		}
	}
	// ==== exchange j-th and k-th column ================================
	for(int i=0;i<CHECK_NUM;i++) {
		int T[VARIABLE_NUM];
		for(int j=0;j<VARIABLE_NUM;j++){T[j]=H[i][j];}
		for(int j1=0;j1<VARIABLE_NUM;j1++){
			int j2 = Perm[j1];
			H[i][j2] = T[j1];
		}
	}
	for(int i=0;i<VARIABLE_NUM-CHECK_NUM;i++) {
		int T[VARIABLE_NUM];
		for(int j=0;j<VARIABLE_NUM;j++){T[j]=G[i*VARIABLE_NUM+j];}
		for(int j1=0;j1<VARIABLE_NUM;j1++){
			int j2 = Perm[j1];
			G[i*VARIABLE_NUM+j2]=T[j1];
		}
	}
}

void decideP(llr input[GF*VARIABLE_NUM],llr mvc[GF*TOTAL_EDGE], llr mcv[GF*TOTAL_EDGE],int interleaver[TOTAL_EDGE],int matValue[TOTAL_EDGE],int limit){
	int e0;
	llr lP;
	int idx;
	for(int n = 0; n < limit; n++){
		for(int g = 0; g < GF; g++){

			e0 = n*VARIABLE_WEIGHT;
			lP = 0.0f;

			// product
			lP = input[n*GF+g];

#pragma unroll 2
			for (int t=0;t<VARIABLE_WEIGHT;t++){

				if(g==0)
					idx = interleaver[e0+t]*GF;
				else
					idx = interleaver[e0+t]*GF+((g-1)+(matValue[interleaver[e0+t]]-1))%(GF-1)+1;

				lP *= mcv[interleaver[e0+t]*GF+idx];

			}

#pragma unroll 2
			for (int t=0;t<VARIABLE_WEIGHT;t++){
				mvc[interleaver[e0+t]*GF+g] = lP;
			}
		}
	}
	//memcpy(mvc,l_mvc,GF*TOTAL_EDGE*sizeof(float));
}

void decideSynd(int syndromeS[CHECK_NUM],int decisionS[VARIABLE_NUM],int ADDGF[GF*GF],int MULGF[GF*GF],
		int MatValue[TOTAL_EDGE],int deinterleaver[TOTAL_EDGE],int limit){
	int e0,Q1,Q,ax,n;

	//burst transfer
	//memcpy(l_decisionS,decideS,VARIABLE_NUM*sizeof(int));

	for(int m = 0; m < limit; m++){
		e0 = m*CHECK_WEIGHT;
		Q  = 0;
		for (int t=0;t<CHECK_WEIGHT;t++){
#pragma HLS UNROLL
			n = deinterleaver[e0+t]/VARIABLE_WEIGHT;
			int tmp = decisionS[n];
			ax = MULGF[tmp*GF + MatValue[e0+t]];
			Q1 = ADDGF[Q*GF + ax];
			Q = Q1;
		}
		syndromeS[m] = Q;
	}
	//memcpy(syndromeS,l_syndromeS,CHECK_NUM*sizeof(int));

}

void decideB(llr mvc[GF*TOTAL_EDGE],int decisionB[LOG_GF*VARIABLE_NUM],int interleaver[TOTAL_EDGE],int limit){
	int e,l;
	int tmp;
	float tmpf;

	for(int n = 0; n < limit; n++){
		for(int i = 0; i < LOG_GF; i++){
			//int n = i/LOG_GF;
			e = n*VARIABLE_WEIGHT;
			l = i%LOG_GF;

			tmpf = mvc[interleaver[e]*GF+l+1];

			tmp=(tmpf<0);

			decisionB[n*LOG_GF+l] = tmp;
		}
	}
}

void decideS(int decisionS[VARIABLE_NUM],int decisionB[LOG_GF*VARIABLE_NUM], int BIN2GF[GF*LOG_GF],int limit){
	int bin;
	int tmp;

	for(int n = 0; n < limit; n++){
		bin = 0;
		for(int l=0;l<LOG_GF;l++){
			tmp = decisionB[n*LOG_GF+LOG_GF-1-l];
			bin = bin*2+tmp;
		}
		int tmpw = BIN2GF[bin];
		decisionS[n] = tmpw;
	}
}


