void permute(llr mvc[GF*TOTAL_EDGE],int matValue[TOTAL_EDGE],int limit){
	llr tmp[GF];
	int idx;


	E:for(int e = 0; e < limit; e++){
		G_read:for(int g = 0; g < GF; g++){
			idx = e*GF + edge_address(e,g,matValue);

			tmp[g] = mvc[idx];
		}
		// fft_after_edge can consume l_mvc directly
		G_write:for(int g = 0; g < GF; g++){
			mvc[e*GF+g] = tmp[g];

		}
	}
}



void cn_proc(llr mvc[GF*TOTAL_EDGE], llr mcv[GF*TOTAL_EDGE],int limit){
	int e,g,m,r,e0;
	static hadamard_llr m0;
	hadamard_llr s[GF];
	hadamard_llr tmp[GF];

	E:for(int e = 0; e < limit; e++){
		G:for(int g = 0; g < GF; g++) {
			//e  = i/GF;
			//g  = i%GF;
			m  = e/CHECK_WEIGHT;
			r  = e%CHECK_WEIGHT;
			e0 = m*CHECK_WEIGHT;
			s[g]  = (hadamard_llr) 1.0;
			CNW:for (int t=0;t<CHECK_WEIGHT;t++){
				if (t!=r){
					s[g] *= (hadamard_llr) l_mvc[(e0+t)*GF+g];
				}
			}
			if(g==0) m0 = s[g];
#ifdef COSIM
			if(m0 == 0) m0 = 0.001;
#endif
			mcv[e*GF+g] = (llr) (s[g]/m0);
		}




	}
}





void depermute(llr mcv[GF*TOTAL_EDGE],int matValue[TOTAL_EDGE],int limit){
	llr tmp[GF];
	int idx;
	//float l_mcv[GF*TOTAL_EDGE];

	E:for(int e = 0; e < limit; e++){
		G_read:for(int g = 0; g < GF; g++){
			idx = e*GF+inv_edge_address(e,g,matValue);
			tmp[g] = mcv[idx];
			if(tmp[g]<0) tmp[g] = 0;
		}

		G_write:for(int g = 0; g < GF; g++)
			mcv[e*GF+g] = tmp[g];
	}
}





void fwht(llr m[GF*TOTAL_EDGE],int FFTSQ[LOG_GF*GF],int limit){
	//int e = i/GF;
	hadamard_llr A[2];
	hadamard_llr mStage[LOG_GF+1][GF];

	E:for(int e = 0; e < limit; e++){
		//int g = i%GF;

		G_read:for(int g = 0; g < GF; g++){
			mStage[0][g] = (hadamard_llr) m[e*GF + g];
		}

		LOGG:for(int c=0;c<LOG_GF;c++){
			G_compute:for(int g = 0; g < GF; g++){

				int k = c*GF+(g/2)*2;
				A[0] = mStage[c][FFTSQ[k+0]];
				A[1] = mStage[c][FFTSQ[k+1]];
				mStage[c+1][FFTSQ[k+(g%2)]] = (1-(g%2)*2) > 0 ? (A[0]+A[1]) : (A[0]-A[1]);
			}
		}

		G_write:for(int g = 0; g < GF; g++){
			m[e*GF + g] = (llr)mStage[LOG_GF][g];
		}
	}
}



void vnDataflow()
{

	vn_proc(l_input, l_mvc, l_mcv,l_interleaver,l_matValue,TOTAL_EDGE);

	permute(l_mvc, l_matValue, TOTAL_EDGE);

	fwht(l_mvc,FFTSQ,TOTAL_EDGE);

}

void cnDataflow()
{

	cn_proc(l_mvc,l_mcv,TOTAL_EDGE);

	fwht(l_mcv,FFTSQ,TOTAL_EDGE);

	depermute(l_mcv,l_matValue,TOTAL_EDGE);

}



void hdDataflow(volatile int *decisions,volatile llr* probabilities)
{

#pragma HLS INTERFACE m_axi port=decisions depth=524288 offset=0x0000
#pragma HLS INTERFACE m_axi port=probabilities depth=524288 offset=0x04000000

#ifdef HD_DATAFLOW
#pragma HLS DATAFLOW
#endif

	llr *input = (llr*) (probabilities);
	llr *mvc   = (llr*) (probabilities+GF*VARIABLE_NUM);
	llr *mcv   = (llr*) (probabilities+GF*VARIABLE_NUM+GF*TOTAL_EDGE);


	decideP(l_input,l_mvc,l_mcv,l_interleaver,l_matValue,VARIABLE_NUM);

	fwht(l_mvc,FFTSQ,TOTAL_EDGE);

	decideB(l_mvc,l_decisionB,l_interleaver,VARIABLE_NUM);

	decideS(l_decisionS,l_decisionB,BIN2GF,VARIABLE_NUM);

	decideSynd(l_syndromeS,l_decisionS,ADDGF,MULGF,l_matValue,l_deinterleaver,CHECK_NUM);

}

