void FFTSPA_Simulator(llr *messages,int *decision,int *word,
		int errorSymbols[1],  int errorWords[1], int avgIterations[1], int maxIterations[1],float SNR[1],
		int error_counter[1]){


#include "LUTS256.h"
#include "fftspaConstants.h"


	// for the integer port
#if 0
	static int decisions[LOG_GF*VARIABLE_NUM+VARIABLE_NUM+CHECK_NUM+VARIABLE_NUM+3];

	// for the floating port
	static llr probabilities[GF*VARIABLE_NUM+GF*TOTAL_EDGE+GF*TOTAL_EDGE];
#else
	int   *decisions     = (int *)  malloc((LOG_GF*VARIABLE_NUM+VARIABLE_NUM+CHECK_NUM+VARIABLE_NUM+3) * sizeof(int));
	llr *probabilities   = (llr *)  malloc((GF*VARIABLE_NUM+GF*TOTAL_EDGE+GF*TOTAL_EDGE)*sizeof(llr));
#endif

	// get also the correct locations for these pointers in the wrapper to fftspa
	static int *decisionB  = (int *) (decisions);
	static int *decisionS  = (int *) (decisions + LOG_GF*VARIABLE_NUM);
	static int *syndromeS  = (int *) (decisions + LOG_GF*VARIABLE_NUM+VARIABLE_NUM);
	static int *Symbol     = (int *) (decisions + LOG_GF*VARIABLE_NUM+VARIABLE_NUM+CHECK_NUM);
	static int *cnt_error  = (int *) (decisions + LOG_GF*VARIABLE_NUM+VARIABLE_NUM+CHECK_NUM+VARIABLE_NUM);
	static int *ir         = (int *) (decisions + LOG_GF*VARIABLE_NUM+VARIABLE_NUM+CHECK_NUM+VARIABLE_NUM+1);
	static int *NIter      = (int *) (decisions + LOG_GF*VARIABLE_NUM+VARIABLE_NUM+CHECK_NUM+VARIABLE_NUM+2);


	static llr *input = (llr*) (probabilities);
	static llr *mvc   = (llr*) (probabilities+GF*VARIABLE_NUM);
	static llr *mcv   = (llr*) (probabilities+GF*VARIABLE_NUM+GF*TOTAL_EDGE);

	cnt_error[0] = 0;
	ir[0] = 0;
	NIter[0] = maxIterations[0];

	int i;
	int is_codeword;
	llr *rw    = (llr*) malloc(VARIABLE_NUM*LOG_GF*sizeof(llr));
	float *Rand1 = (float*) malloc(VARIABLE_NUM*LOG_GF*sizeof(float));
	float *Rand2 = (float*) malloc(VARIABLE_NUM*LOG_GF*sizeof(float));
	int *interleaver = (int*) malloc(TOTAL_EDGE*sizeof(int));
	float ch[1];
	ch[0] = SNR[0];
	int *Bit = (int*) malloc(VARIABLE_NUM*LOG_GF*sizeof(int));
	static int transmission=0;
	int *G = (int*) malloc((VARIABLE_NUM-CHECK_NUM)*VARIABLE_NUM*sizeof(int));

	clock_t tstart;
	clock_t tstop;
	float throughput;

	for(i=0;i<VARIABLE_NUM*LOG_GF;i++){
		Rand1[i] = h_Rand1[i];
		Rand2[i] = h_Rand2[i];
	}



	if(LOG_GF != 2 && LOG_GF != 3 && LOG_GF != 4 && LOG_GF != 5)
		InitEncoding(l_interleaver,l_matValue,CHECK_NUM,VARIABLE_NUM,ADDGF,MULGF,DIVGF,G);


	if(LOG_GF == 2 || LOG_GF == 3 || LOG_GF == 4 || LOG_GF == 5)
		Encoding(VARIABLE_NUM-CHECK_NUM,VARIABLE_NUM,G,Symbol,ADDGF,MULGF,1);
	else
		Encoding(VARIABLE_NUM-CHECK_NUM,VARIABLE_NUM,G,Symbol,ADDGF,MULGF,0);

	for(i = 0; i < VARIABLE_NUM; i++){
		initialize_message(input, BINGF, Symbol, Rand1,Rand2,ch,rw,Bit,i);
	}

	for(i = 0; i < TOTAL_EDGE*GF; i++)
		init_mcv(mcv,i);

	//*******************************************************

	tstart = clock();

	fftspa(decisions,probabilities);

	tstop = clock();

	throughput = (float)(VARIABLE_NUM * LOG_GF)/(float)((tstop - tstart)/(float)CLOCKS_PER_SEC)/(float)1e3;

	printf("Functionality Throughput (SD+HD): %3.3f\n",throughput);

	//*******************************************************
	transmission++;
	if(cnt_error[0]){
		errorSymbols[0]+=cnt_error[0];
		is_codeword = 0;
		if(cnt_error[0])
			errorWords[0]++;
	}

	avgIterations[0] =  ir[0];
	error_counter[0] = cnt_error[0];

	free(probabilities);
	free(decisions);
	free(G);
	free(Bit);
	free(interleaver);
	free(Rand2);
	free(Rand1);
	free(rw);

	return;
}

